    [],nt"revision_timestamp": "2015-05-06T21:40:18.365193",nt"name": "on-demand-special-use-airspace-project",nt"isopen":
    true,nt"url": null,nt"notes": "We design and develope a Decision Support
    Tool (DST) that supports On-Demand Special Use Airspace (SUA) scheduling and flight
    plan optimization around SUA between Airline Operations Control (AOC), Military,
    Air Traffic Control System Command Center (ATCSCC), and Air Route Traffic Control
    Center (ARTCC) personnel.  The tool allows AOC and ARTCC Traffic Management Unit
    (TMU) personnel to coordinate strategic and tactical plans, with a strategic look
    ahead time from days to less than 2 hours, and tactical plans up to the minute centered
    locally around an ARTCC airspace.  The tool coordinates aircraft movement though
    vs around SUA.  The tool allows for asynchronous communication of priorities associated
    with flight plans and flight plan amendments (contingency plans) between the AOC
    and ARTCC TMU specialist, allowing the ATCSCC and Military to view these priorities
    and TMU responses to them at any time.  This technology will be developed to Technology
    Readiness Level (TRL) 2 by the end of Phase I, and TRL 4 prototype system by the
    end of Phase II.",nt"license_title": "U.S. Government Work",nt"extras":
